import React from 'react';
import {Route, Switch} from "react-router";
import MetaRegistForm from "../../admin/MetaRegistForm";
import MoobeHome from "../../home/Home";
import MoobeLogin from "../login/login";
import MoobeNavBar from "./Navbar";


const withoutNavbar = BaseComponent => (
    <>
        <section className="hero is-fullheight">
            <div className="hero-body align-items-flex-start">
                <section className="container">
                    <BaseComponent />
                </section>
            </div>
        </section>
    </>
);

const withNavbar = BaseComponent => (
    <>
        <MoobeNavBar/>
        <section className="hero is-fullheight-with-navbar is-fullheight-with-navbar-mobile">
            <div className="hero-body is-paddingless">
                <section className="container">
                    <BaseComponent />
                </section>
            </div>
        </section>
    </>
);

const MoobeBody = () => {
    return (
        <>
            <Switch>
                <Route exact path="/login" >
                    {withoutNavbar(MoobeLogin)}
                </Route>
                <Route exact path="/admin" >
                    {withoutNavbar(MetaRegistForm)}
                </Route>
                <Route exact path={["/", "/channels/:channelId", "/contents/:contentId", "/channels/:channelId/contents/:contentId"]}>
                    {withNavbar(MoobeHome)}
                </Route>
                <Route>
                    <div>
                        Not Found
                    </div>
                </Route>
            </Switch>
        </>

    )
};

export default MoobeBody;
